import React from 'react'

const PopUpForm = () => {
    return (
        <div class="form_wrap">
            <input>Введи имея</input>
            <button>Ок</button>
        </div>
    )
}

export const PopUp = ({setIsOpenPopUp}) => {
    const onClickBtn = () => {
        setIsOpenPopUp(false);
    }
    return (
        <div class="popup_wrap">
            <div class="popup">
                <p>Title</p>
                <div class="popup_inner"></div>
                <button onClick={onClickBtn}>Начать игру</button>
            </div>
        </div>
    )
}
